class HeaderNavigator extends ComponentsManager {
    constructor() {
        super();
        this.props = {
            class: "HeaderNav"
        };
    }
    type = "div";
    style = {
        type: 'w-style', props: {
            id: '', ClassList: [
                new WCssClass(".HeaderNav", {
                    display: "flex",
                    "justify-content": " space-between",
                    //"box-shadow": "0 2px 5px 2px rgba(0,0,0,0.5)",
                    overflow: "hidden",
                    padding: "10px 30px"
                }),
                new WCssClass(`.HeaderNav img`, {
                    height: 30,
                    width: 30,
                    opacity: "0.6",
                    margin: "0px 10px"
                })
            ]
        }
    }
    icons = {
        home: "data:image/png;base64,",
        perfil: "data:image/png;base64,",
        foro: "data:image/png;base64,",
        info: "data:image/png;base64,"
    }
    children = [this.style,
    {
        type: 'img', props: {
            src: this.icons.home, class: 'className', onclick: async () => {
                DOMManager.NavigateFunction("HomeClass", new HomeClass(), "AppMain");
            }
        }
    }, {
        type: 'img', props: {
            src: this.icons.foro, class: 'className', onclick: async () => {
                DOMManager.NavigateFunction("ForosView", new ForosView(), "AppMain");
            }
        }
    }, {
        type: 'img', props: {
            src: this.icons.perfil, class: 'className', onclick: async () => {
                if (!WSecurity.Auth()) {
                    WSecurity.LoginIn();
                    return;
                }
                DOMManager.NavigateFunction("PerfilView", new PerfilView(WSecurity.User()), "AppMain");
            }
        }
    }, {
        type: 'img', props: {
            src: this.icons.info, class: 'className', onclick: async () => {
                DOMManager.NavigateFunction("InfoView", new InfoView(), "AppMain");
            }
        }
    }];
}
